import React from 'react'

const ToDoItem = ({todo,onDelete}) => {
  return (
    <div>
      <h4>{todo.Sno}.{todo.title}</h4>
      <p>{todo.desc}</p>
      <button className="btn btn-sm btn-danger" onClick={()=>{onDelete(todo)}}>Delete</button><br /><br />
    </div>
  )
}

export default ToDoItem
